import React from "react";
import Logo from "./asset/logo.png";
import Button from "@mui/material/Button";
import NestedList1 from "./NestedList1";
import NestedList2 from "./NestedList2";
import NestedList3 from "./NestedList3";
import NestedList4 from "./NestedList4";

const Header = () => {
  return (
    <div className="header layout_row">
      <div>
        <NestedList1 />
        <NestedList2 />
        <NestedList3 />
        <NestedList4 />
      </div>
      <div>
        <img src={Logo} alt="logo"></img>
      </div>
      <div></div>
      <Button variant="contained">Hello world</Button>
    </div>
  );
};

export default Header;
